Are you sure you want to delete your Supervisor account?
This will also remove:

Your associated buyers;
All their specific data, like orders, messages, tokens;
Your own user tokens (if any);
Your message history from UNITE.

Please be very careful with this option!

Are you sure you want to deactivate your Supplier account?
This will remove the following data:

Your products/services;
Your capabilities;
Your received orders from UNITE.
You will not be visible to Buyers looking for capabilities on the Site.

Are you sure you want to delete your Supplier account?
This will also remove:
>Your products/services;
Your capabilities
Your received orders;
Your user tokens (if any);
Your message history from UNITE.

If you just want to take a break, you may deactivate your account instead.
